import React from 'react'
import DashboardsNavbar from '../components/Dashboardnavbar';
import Footer from '../components/Footer';

export default function TuoristDashboard() {
  return (
    <div>
      <Dashboardsnavbar
       name={user?.name}
        role={user?.role}
        profilePhoto={user?.profilePhoto}
        
        />

      <Footer />
    </div>
  )
}
